     public static int findMaxConsecutiveOnes(int[] nums) {
        int Max = 0;
        int count = 0 ; 
        for(int i = 0 ; i<nums.length ; i++){

            if(nums[i] == 1){

                count+=1;
                if(count > Max){
                    Max = count;
                }
            }
            else{
                count = 0;
            }
        }
        
        return Max;
    }
